  \"Small mammal diversity and abundances in three central Iowa grassland habitat
  types\",\n\t\"tracking_summary\": {\n\t\t\"total\": 9,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:28.152729\",\n\t\"name\":
  \"small-mammal-diversity-and-abundances-in-three-central-iowa-grassland-habitat-types\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Small mammals were studied in three central
  Iowa grassland habitat types to test the hypothesis that species diversity and abundances
  are lower in relatively pure stands of replanted native grasses than in vegetatively
  more diverse prairie or old-field habitats. Snap trapping was conducted at 10 sites
  of each habitat type between 19 June and 4 August 1992. Study sites were located
  in Jasper and eastern Polk counties, Iowa. Relevant vegetation data were recorded.
  Calculated small mammal diversity indices and abundances were similar for all three
  habitat types. The lack of significant relationships between habitat and species
  diversity may have been due to the small size of the study sites.    Because there
  were no habitat effects, and to increase sample sizes, data from all trap stations
  were combined. Species were grouped into guilds of grainivores, herbivores, and
  insectivores. Principal Component Analysis was used to characterize the vegetation
  data. These results, with the combined trapping data, were used to construct multiple
  stepwise regressions. The regression for grainivores was not significant. However,
  regressions for herbivores and insectivores accounted for 4% and 10% of the variation,
  respectively. Similar regressions, combining the data by trap lines, accounted for
  considerably more of the variation in these two guilds (27% for herbivores, 43%.
  for insectivores). These results indicate that small mammal species may be responding
  more to vegetation structure than to plant composition.\",\n\t\"license_title\":
